import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";

import Index from "../screens/index";

const Router = () => {
    return (
        <BrowserRouter>
            <Routes> 
                <Route>
                    <Route index component={Index} path="/" exact />
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default Router;
